import React from "react";
import Contact from "../components/contact"

export default function ContactList(props) {
    return (
        <div>
            {props.item.map(function (value, index){
            return <Contact key={index} contact={value} onDelete={this.props.onDeleteContact}></Contact>
        })}
        </div>
    )
}
